import Slider from 'react-slick'

const Testimonials = () => {
  return (
    <Slider>
        <div className="testimonial py-4 px-3">
            <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Aliquam excepturi at quis voluptatum modi pariatur, doloremque error quam omnis laboriosam commodi consectetur, amet debitis? Id pariatur facilis corporis quaerat sunt?</p>
        </div>
    </Slider>
  )
}

export default Testimonials
